// frontend/src/components/DashboardNavbar.js

import React from 'react';
import { useNavigate } from 'react-router-dom';

const DashboardNavbar = ({ username, onLogout, onNavigate }) => {
    return (
        <div className="dashboard-navbar">
            <h1 className="logo">airbnb</h1>
            <div className="nav-buttons">
                <button onClick={() => onNavigate('listings')}>View Listings</button>
                <button onClick={() => onNavigate('reservations')}>View Reservations</button>
                <button onClick={() => onNavigate('createListing')}>Create Listing</button>
            </div>
            <div className="user-info">
                <span>Welcome, {username}</span>
                <button onClick={onLogout}>Logout</button>
            </div>
        </div>
    );
};

export default DashboardNavbar;
